import React, { Component } from "react";
import Firebase from "./database";
import './main.css'
class Result3 extends Component {
  state = {};
  componentDidMount() {
    var key = this.props.match.params.key;
    Firebase.database()
      .ref("CV/" + key)
      .on("value", list => {
        var object = list.val();
        var name = object.Name;
        var address = object.Address;
        var PT = object.PT;
        var PhoneNumber = object.PN;
        var Gmail = object.Gmail;
        var Major = object.Major;
        var NameOfUniversity = object.NOU;
        var Degree = object.Degree;
        var Skill1 = object.Skill1;
        var Skill2 = object.Skill2;
        var Skill3 = object.Skill3;
        var Skill4 = object.Skill4;

        var Profile = object.Profile;
        var WE1 = object.WE1;
        var WE2 = object.WE2;
        var WE3 = object.WE3;
        var WE4 = object.WE4;
        var JT = object.JT;
        var In = object.In;
        var ProfileP = object.profileP;

        this.setState({
          name: name,
          address: address,
          PT: PT,
          PhoneNumber: PhoneNumber,
          Gmail: Gmail,
          Major: Major,
          NameOfUniversity: NameOfUniversity,
          Degree: Degree,
          Skill1: Skill1,
          Skill2: Skill2,
          Skill3: Skill3,
          Skill4: Skill4,
          Profile: Profile,
          WE1: WE1,
          WE2: WE2,
          WE3: WE3,
          WE4: WE4,
          JT: JT,
          In: In,
          avatar: ProfileP
        });
      });
  }
  render() {
    return (
      <div className="template3MainDiv">


        <div className='template3SecondaryDiv' >
          <img className="dev_logoT2" src={this.state.avatar} />

          <h1 className='template3MainDivElmnts'>{this.state.name}</h1>
          <hr />
          <h1 className='template3MainDivElmnts'>{this.state.address}</h1>
          <hr />
          <h1 className='template3MainDivElmnts'>{this.state.PhoneNumber}</h1>
          <hr />
          <h1 className='template3MainDivElmnts'>{this.state.Gmail}</h1>
          <hr />
          <h1 className='template3MainDivElmnts'>{this.state.In}</h1>


        </div>


        <div className='template3MainDivElmnts'>


          <div className="AllCvs">
            <div className="CvElmntLight">
              <p className="Cv_titleLight">Proffesional title</p>
              <h5 className='DarkText'>{this.state.PT} </h5>
            </div>

            <div className="CvElmntLight">
              <p className="Cv_titleLight">Major</p>
              <h5 className='DarkText'>{this.state.Major} </h5>
            </div>

            <div className="CvElmntLight">
              <p className="Cv_titleLight">Name of university</p>
              <h5 className='DarkText'>{this.state.NameOfUniversity} </h5>
            </div>

            <div className="CvElmntLight">
              <p className="Cv_titleLight">Degrees</p>
              <h5 className='DarkText'>{this.state.Degree} </h5>
            </div>
          </div>
          <div className="AllCvs">
            <div className="CvElmntLight">
              <p className="Cv_titleLight">Major</p>
              <h5 className='DarkText'>{this.state.Major} </h5>
            </div>

            <div className="CvElmntLight">
              <p className="Cv_titleLight">Skills</p>
              <ol>
                <li className='DarkText'>{this.state.Skill1}</li>
                <li className='DarkText'>{this.state.Skill2}</li>
                <li className='DarkText'>{this.state.Skill3}</li>
                <li className='DarkText'>{this.state.Skill4}</li>

              </ol>
              <h5 className='DarkText'>{this.state.Skills} </h5>
            </div>

            <div className="CvElmntLight">
              <p className="Cv_titleLight">Work experiance</p>

              <ol>
                <li className='DarkText'>{this.state.WE1}</li>
                <li className='DarkText'>{this.state.WE2}</li>
                <li className='DarkText'>{this.state.WE3}</li>
                <li className='DarkText'>{this.state.WE4}</li>

              </ol>
            </div>

            <div className="CvElmntLight">
              <p className="Cv_titleLight">Jop title</p>

              <h5 className='DarkText'>{this.state.JT} </h5>
            </div>
          </div>

          <div className="Footer">
            <a className='FooterObj' href={"/template1/" + this.props.match.params.key} >Template1</a>
            <a className='FooterObj' href={"/template2/" + this.props.match.params.key} >Template2</a>
            <a className='FooterObj' href={"/template3/" + this.props.match.params.key} > Template3</a>
            <a className='FooterObj' href={"/template4/" + this.props.match.params.key} >Template4</a>
            <a className='FooterObj' href={"/template5/" + this.props.match.params.key} >Template5</a>

          </div>

        </div>




      </div>
    );
  }
}
export default Result3;
